DROP PROCEDURE IF EXISTS `SP_AtualizaItemPedido`;;
CREATE PROCEDURE `SP_AtualizaItemPedido`(IN `id_prod` int, IN `id_pedido` char(50) CHARACTER SET 'utf8')
BEGIN
    declare desc_p varchar(250);
    declare unid char(20);
    declare valor_un decimal(20,2);
    declare subtotal decimal(20,2);
    

   
    SELECT descricao, unidade, preco, subtotal into desc_p, unid, valor_un
    FROM tbl_produtos, tbl_itens_pedido WHERE id = id_prod;
   
    UPDATE tbl_itens_pedido SET descricao= desc_p, unidade= unid, valor_unit= valor_un
    WHERE id_produto = id_prod;

    SELECT Sum(P.preco * I.quantidade) into subtotal
    FROM tbl_pedidos_venda as F
    INNER JOIN tbl_itens_pedido as I
    ON F.numero_pedido = I.id_pedido
    INNER JOIN tbl_produtos as P
    ON I.id_produto = P.id
    WHERE I.id_pedido = id_pedido;
     
    UPDATE tbl_pedidos_venda SET faturamento= subtotal WHERE numero_pedido = id_pedido;
  
END;;

DROP PROCEDURE IF EXISTS `SP_AtualizaPedido`;;
CREATE PROCEDURE `SP_AtualizaPedido`(IN `id_fatura` char(50), IN `id_prod` int(11), IN `qtde` decimal(20,3), IN `desconto` decimal(20,2))
BEGIN
    declare valor_produto decimal(20,2);
     
    select preco into valor_produto from tbl_produtos WHERE id = id_prod;

    IF valor_produto > 0 THEN
      UPDATE tbl_pedidos_venda SET faturamento=(qtde * valor_produto) - desconto
      WHERE tbl_pedidos_venda.numero_pedido = id_fatura;
    END IF;
  
END;;

DROP PROCEDURE IF EXISTS `SP_AtualizaVenda`;;
CREATE PROCEDURE `SP_AtualizaVenda`(IN `id_fatura` char(50))
BEGIN

  declare subtotal decimal(20,2);
  declare tdescontos decimal(20,2);
  
    SELECT Sum(P.preco * I.quantidade - I.desconto) into subtotal
    FROM tbl_pedidos_venda as F
    INNER JOIN tbl_itens_pedido as I
    ON F.numero_pedido = I.id_pedido
    INNER JOIN tbl_produtos as P
    ON I.id_produto = P.id
    WHERE I.id_pedido = id_fatura;  
    
    select distinct
    (F.desconto+F.taxas_adicionais+F.frete) into tdescontos
    FROM tbl_pedidos_venda as F
    WHERE F.numero_pedido = id_fatura;


    UPDATE tbl_pedidos_venda SET faturamento=subtotal, valor_total=subtotal-tdescontos
    WHERE numero_pedido = id_fatura;

END;;

